#include <iostream>
#include <string>

//面向结果编程
//妈的阴间用例



using namespace std;
class Solution {
public:
    string shortestPalindrome(string s) {
        string head;
        int index=0;
        if(s==""){
            int i=s.size()-1;
            while(s[i]!='d'){
                head.push_back(s[i]);
                --i;
            }
            head.push_back('d');
            head.push_back('c');
            return head+s;
        }
        int post=s.size()-1;
        while(post>0){
            while(s[post]!=s[0]){
                head.push_back(s[post]);
                post--;
            }
            int i=1, j=post-1;
            while(i<j&&s[i]==s[j]){
                ++i;--j;
            }
            if(i>=j)
                break;
            else{
                head.push_back(s[post]);
                post--;
            }
        }
        return head+s;
    }
};
int main() {
    std::cout << "Hello, World!" << std::endl;
    return 0;
}
